import React, { Component } from "react";
import NavComponent from "./navcomponent";

class ContactComponent extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <div>contacts</div>
        <NavComponent />
      </div>
    );
  }
}

export default ContactComponent;
